import React from 'react';
import './App.css';
import Customer from './components/Customer';

const customer = {
  id: 1,
  image: 'https://placeimg.com/64/64/any',
  name: '홍길동',
  birthday: 19931221,
  gender: 'male',
  job: 'developer',
};

const App = () => {
  return (
    <div className="gray-background">
      <Customer {...customer} />
    </div>
  );
};
export default App;
